CREATE OR REPLACE FUNCTION nth_id_from_table(column_name text, table_name text, n integer)
    RETURNS uuid AS $id$
DECLARE
    id uuid;
BEGIN
    EXECUTE 'SELECT ' || column_name || ' FROM ' || table_name || ' OFFSET ' || (n - 1) || ' LIMIT 1' INTO id;
    return id;
END;
$id$ LANGUAGE plpgsql;

CREATE OR REPLACE FUNCTION random_id_from_table(column_name text, table_name text)
    RETURNS uuid AS $id$
DECLARE
    id uuid;
BEGIN
    EXECUTE 'SELECT ' || column_name || ' FROM ' || table_name || ' OFFSET floor(random() * (SELECT count(*) FROM ' || table_name || '))  LIMIT 1' INTO id;
    return id;
END;
$id$ LANGUAGE plpgsql;







